import React from "react";
import CardStat from "./CardStat";

const LeftSideBar = () => {
  return (
    <div className="row">
      <div className="col-md-12">
        <CardStat
          header="Total"
          title="Affected"
          text="500"
          footer="ajksndjasn"
        />
      </div>
    </div>
  );
};

export default LeftSideBar;
